con:config.con:query:
SELECT TOP 10 A.BNDYNR AS DAY_NO , A.BNSQNO AS SEQUENCE_WITHIN_DAY_NBR , A.BNTOCD AS In_Cruise_Tour_Code , D.BLCIID AS START_CITY_CODE , D.BLCINM AS START_CITY_NAME , E.BLCIID AS END_CITY_CODE , E.BLCINM AS END_CITY_NAME , B.BACMDS AS COMPONENT_DESC , B.BACMSD AS COMPONENT_SHORT_DESC , B.BATCCD AS COMPONENT_TYPE_CODE , B.BAPVCD AS COMPONENT_PROVIDER_CODE , C.BCCTRC AS COMPONENT_TYPE_TRANS_CODE , F.BGPVNM AS COMPONENT_PROVIDER_NAME
FROM AS400_Mirror.dbo.TRSCHD A INNER JOIN AS400_Mirror.dbo.TRCOMD B ON A.BNCMCD = B.BACMCD INNER JOIN AS400_Mirror.dbo.TRPKMD ON A.BNTOCD = EITOCD INNER JOIN AS400_Mirror.dbo.TRCTYD C ON B.BATCCD = C.BCTCCD LEFT OUTER JOIN AS400_Mirror.dbo.TRCITD D ON B.BASCID = D.BLCIID LEFT OUTER JOIN AS400_Mirror.dbo.TRCITD E ON B.BAECID = E.BLCIID INNER JOIN AS400_Mirror.dbo.TRPRVD F ON B.BAPVCD = F.BGPVCD
WHERE EIRCTF = 'Y' --AND A.BNTOCD = @In_Cruise_Tour_Code;
